package main.java.ex07;

public class Exam0111 {

  static void printSpaces(int len) {
    int spaceCnt = 1;
    while (spaceCnt <= len) {
      System.out.print(" ");
      spaceCnt++;
    }
  }

  public static void main(String[] args) {
    // TODO Auto-generated method stub
    System.out.println();
  }
}
